import React, {Component} from 'react';

const styles ={
    span:{
        marginRight: '100px'
    },
};

export default class TodoItem extends Component{
    constructor(props){
        super(props);
        this.state={};
    }

    render(){
        const {checked, todo} = this.props
        return(
                <li>
                    <input 
                     type="checkbox" 
                     name ="" 
                     id="" 
                     onChange={()=>{
                        checked(todo.id);
                     }}
                    />
                    <span style={styles.span}>{todo.title}</span>
                    <button>Delete</button>
                </li>   
            );
    }
}
